____&quot;^15logseq____&quot;,[1817,logseq____&quot;^Vlogseq____&quot;,1801,536870963]],[logseq____&quot;^15logseq____&quot;,[1817,logseq____&quot;^Ulogseq____&quot;,65,536870963]],[logseq____&quot;^15logseq____&quot;,[1817,logseq____&quot;^Ulogseq____&quot;,1771,536870963]],[logseq____&quot;^15logseq____&quot;,[1817,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u671c7c27-169a-4cf9-8916-cede03e25140logseq____&quot;,536870963]],[logseq____&quot;^15logseq____&quot;,[1819,logseq____&quot;^Klogseq____&quot;,1729920039783,536870964]],[logseq____&quot;^15logseq____&quot;,[1819,logseq____&quot;^@logseq____&quot;,false,536870964]],[logseq____&quot;^15logseq____&quot;,[1819,logseq____&quot;^Ylogseq____&quot;,logseq____&quot;1logseq____&quot;,536870964]],[logseq____&quot;^15logseq____&quot;,[1819,logseq____&quot;^11logseq____&quot;,logseq____&quot;1logseq____&quot;,536870964]],[logseq____&quot;^15logseq____&quot;,[1819,logseq____&quot;^Blogseq____&quot;,1729920039783,536870964]],[logseq____&quot;^15logseq____&quot;,[1819,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u671c7c27-732b-4525-bcb2-5b33993ca330logseq____&quot;,536870964]],[logseq____&quot;^15logseq____&quot;,[1820,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;‘Erased Dreams’, the first full-length, low-tempo project from Helsinki based artist Yotto.logseq____&quot;,536870964]],[logseq____&quot;^15logseq____&quot;,[1820,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536870964]],[logseq____&quot;^15logseq____&quot;,[1820,logseq____&quot;^Flogseq____&quot;,21,536870964]],[logseq____&quot;^15logseq____&quot;,[1820,logseq____&quot;^Xlogseq____&quot;,21,536870964]],[logseq____&quot;^15logseq____&quot;,[1820,logseq____&quot;^Vlogseq____&quot;,21,536870964]],[logseq____&quot;^15logseq____&quot;,[1820,logseq____&quot;^Ulogseq____&quot;,21,536870964]],[logseq____&quot;^15logseq____&quot;,[1820,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u671c7c27-8304-40eb-8f08-a57bf362096blogseq____&quot;,536870964]],[logseq____&quot;^15logseq____&quot;,[1821,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;Aptly regarded as a man of many sounds by Billboard, Yotto’s ‘Erased Dreams’ also marks Reflections’ debut LP release; an 8 track ambient journey, revealing a new side to one of Anjuna’s most illustrious producers. Well-known for his thunderous DJ sets and deep, bass-heavy house productions, ‘Erased Dreams’ may seem like a departure from Yotto’s usual style, but he’s always made music like this. With Reflections, he finally found a home for it.logseq____&quot;,536870964]],[logseq____&quot;^15logseq____&quot;,[1821,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536870964]],[logseq____&quot;^15logseq____&quot;,[1821,logseq____&quot;^Flogseq____&quot;,1820,536870964]],[logseq____&quot;^15logseq____&quot;,[1821,logseq____&quot;^Xlogseq____&quot;,21,536870964]],[logseq____&quot;^15logseq____&quot;,[1821,logseq____&quot;^Vlogseq____&quot;,21,536870964]],[logseq____&quot;^15logseq____&quot;,[1821,logseq____&quot;^Ulogseq____&quot;,21,536870964]],[logseq____&quot;^15logseq____&quot;,[1821,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u671c7c27-734a-4ec9-b2b0-ca1bad38930elogseq____&quot;,536870964]],[logseq____&quot;^15logseq____&quot;,[1822,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;Throughout his sparkling career, which includes a Billboard #1 LP and remixes of tracks by Joris Voorn, Gorillaz and Coldplay, Yotto has produced ambient music to help him look inward and re-charge his creative battery. But when COVID hit, his inner world took over. “At first, I was being really productive with club music. But then after a while I started making something completely opposite.” Yotto found himself exploring a different form of expression, with no plan other than to create. But when he put the tracks side-by-side in a playlist he recognised a synergy, and the outline of the project began to take shape. The result is more of a continuous soundscape than an album; an ethereal and dreamy experience designed to accompany the listener as they turn inward and drift away. If club music is a form of escape, then this is too – but instead of turning outward, we lose ourselves inward.logseq____&quot;,536870964]],[logseq____&quot;^15logseq____&quot;,[1822,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536870964]],[logseq____&quot;^15logseq____&quot;,[1822,logseq____&quot;^Flogseq____&quot;,1821,536870964]],[logseq____&quot;^15logseq____&quot;,[1822,logseq____&quot;^Xlogseq____&quot;,21,536870964]],[logseq____&quot;^15logseq____&quot;,[1822,logseq____&quot;^Vlogseq____&quot;,21,536870964]],[logseq____&quot;^15logseq____&quot;,[1822,logseq____&quot;^Ulogseq____&quot;,21,536870964]],[logseq____&quot;^15logseq____&quot;,[1822,logseq____&quot;^Ulogseq____&quot;,1819,536870964]],[logseq____&quot;^15logseq____&quot;,[1822,logseq____&quot;^Hlogseq____&quot;,1819,536870964]],[logseq____&quot;^15logseq____&quot;,[1822,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u671c7c27-0be0-4405-97c2-d1a11c2b8974logseq____&quot;,536870964]],[logseq____&quot;^15logseq____&quot;,[1823,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;The first single is ‘Silhouette’. It’s a melancholy, atmospheric track with hints of ’80s nostalgia and smooth as glass vocals from Sansa. The track conjures up images of vast and endless landscapes; the sense of space enhanced by sparse chord-changes and field recordings of heavy rain. ‘Silhouette’ is so human it feels like an extension of an emotion, and Yotto says the idea came to him like a dream. A sound drifted towards him one day and he caught it by the tail and built on top of it until it became the entity he envisioned. ’It’s slow and steady and it grows. I think the beauty lies in the simplicity of it.”logseq____&quot;,536870964]],[logseq____&quot;^15logseq____&quot;,[1823,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536870964]]  <script type="text/javascript">// Single Page Apps for GitHub Pages

      // This script checks to see if a redirect is present in the query string
      // and converts it back into the correct url and adds it to the
      // browser's history using window.history.replaceState(...),
      // which won't cause the browser to attempt to load the new url.
      // When the single page app is loaded further down in this file,
      // the correct url will be waiting in the browser's history for
      // the single page app to route accordingly.
      (function(l) {
        if (l.search) {
          var q = {};
          l.search.slice(1).split('&').forEach(function(v) {
            var a = v.split('=');
            q[a[0]] = a.slice(1).join('=').replace(/~and~/g, '&');
          });
          if (q.p !== undefined) {
            window.history.replaceState(null, null,
              l.pathname.slice(0, -1) + (q.p || '') +
              (q.q ? ('?' + q.q) : '') +
              l.hash
            );
          }
        }
      }(window.location))</script>
